import React, { useState } from "react";
import axios from "axios";

const Parents = () => {
  const [email, setEmail] = useState("");
  const [userData, setUserData] = useState(null);

  const getUserData = async () => {
    try {
        console.log('Email before Axios request:', email);
    //   const response = await axios.get(`http://localhost:5000/api/Signup/getuser?email=${email}`);
    const response = await axios.get(`http://localhost:5000/api/users/getuser?email=${encodeURIComponent(email)}`);
    // const response = await axios.get(`http://localhost:5000/api/Signup/getuser?email=${encodeURIComponent(email)}`);

    console.log('Response from server:', response.data);
    //   console.log(response.data);
      if (response.data.auth == true) {
        setUserData(response.data);
      } else {
        alert(response.data.message);
        setUserData(null);
      }
    } catch (error) {
      console.error("Error:", error);
      alert("Error fetching user data");
      setUserData(null);
    }
  };
  

  return (
    <div className="parent">
      <div className="subscribe">
      <label htmlFor="email">Enter Email:</label>
      <input
        type="email"
        id="email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
      />
      <button className="submit-btn" onClick={getUserData}>Get User Data</button>
      </div>
      <div  className="pcard-container">
      {userData && (
        <div className="pdata">
          <div className="pcards">
            <div className="pcard" style={{ width: "18rem" }}>
              <div className="pcard-body">
                <h5 className="pcard-title">User Data</h5>
                <p className="pcard-text">
                  Name: {userData.user_data?.name ?? "null"},
                  <br />
                  Age: {userData.user_data?.age ?? "null"},
                  <br />
                  Email: {userData.user_data?.email ?? "null"},
                </p>
              </div>
            </div>


            <div className="pcard" style={{ width: "18rem" }}>
              <div className="pcard-body">
                <h5 className="pcard-title">Puzzle Game</h5>
                <p className="pcard-text">
                  Puzzle Level: {userData.puzzle?.level ?? "null"},
                  <br />
                  Puzzle Completed:  {userData.puzzle?.isCompleted?.toString() ?? "null"},
                </p>
              </div>
            </div>


            <div className="pcard" style={{ width: "18rem" }}>
              <div className="pcard-body">
                <h5 className="pcard-title">Waga mole Game</h5>
                <p className="pcard-text">
                    Whack A Mole:{userData.wagascore?.score ?? "null"},
                  Wagamole Level: {userData.wagascore?.level ?? "null"},
                  <br />
                  Wagamole Completed:  {userData.wagascore?.isCompleted?.toString() ?? "null"},
                </p>
              </div>
            </div>


            <div className="pcard" style={{ width: "18rem" }}>
              <div className="pcard-body">
                <h5 className="pcard-title">Candy Crush Game</h5>
                <p className="pcard-text">
                  Candy Crush Level: {userData.wagascore?.level ?? "null"},
                  <br />
                  Candy Crush Completed:  {userData.wagascore?.isCompleted?.toString() ?? "null"},
                </p>
              </div>
            </div>

             <div className="pcard" style={{ width: "18rem" }}>
              <div className="pcard-body">
